import React from "react";
import { Router, Routes } from "react-router-dom";
import "./App.css";
import Authenticated from "./authenticated";
import Unauthenticated from "./unauthenticated";

function App() {
  return (
    <Router>
      <Routes>
        <div>
          <Unauthenticated />
          <Authenticated />
        </div>
      </Routes>
    </Router>
  );
}

export default App;
